db.patients.aggregate([
    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$ENCOUNTERS.MEDICATIONS" },
    { $match: {
        "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Simvastatin 10 MG Oral Tablet"
    }},
    { $group: {
        _id: {
            medication: "$ENCOUNTERS.MEDICATIONS.DESCRIPTION"
        },
        success_count: { $sum: 1 }
    }},
    { $project: {
        _id: 0,
        medication: "$_id.medication",
        success_rate: {
            $cond: [
                { $eq: [ "$success_count", 0 ] },
                0,
                { $divide: [ "$success_count", 1 ] }
            ]
        }
    }}
])

